import React from 'react'


export default function contactsMasonry({Contacts}){
    return( 
            <div  id="list-wrapper">         
                    {Contacts.map(function(contact, index){
                      return(
                          <div key={index} className="contacts-wrapper flex-wrapper">

                            <div style={{flex:7}}>
                                    <span>{contact.name}</span>
                            </div>

                            <div style={{flex:1}}>
                                <button onClick={() => self.Updating(contact)}>Edit</button>
                            </div>

                            <div style={{flex:1}}>
                                <button onClick={() => self.deleteItem(contact)}>-</button>
                            </div>

                          </div>
                        )
                    })}
              </div>
    )
}
